      this.state = {
        data: []
      }
    }

    componentWillReceiveProps(){
      this.setState({
        data: this.props.data
      })
    }

    render(){
      const data = this.state.data;
      console.log("CourseAdvice data for collapsible:")
      console.log(this.state)
