      <div className="collapsiblerow">
        <div className="displaydata">
        {data.map(element => {
          return (<div>{element.text}</div>)
        })
        }
        </div>
        <div className="datanav">


        </div>
      </div>

      </Collapsible>

        </div>
      )
    }
  }

